import Div100vh from 'react-div-100vh'
import FactionSelect from "./components/FactionSelect"
import {
  createBrowserRouter,
  RouterProvider,
} from "react-router-dom";
import './App.css';

const router = createBrowserRouter([
  {
    path: "/",
    element: <FactionSelect />
  }
]);


function App() {
  return (
    <Div100vh>
      <div className='App'>
        <RouterProvider router={router} />
      </div>
    </Div100vh>
  );
}

export default App;
